using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public partial struct SoundVolumeComponentResolver : IResolver<SoundVolumeComponent>, IResolver<SoundVolumeComponentResolver,SoundVolumeComponent>, IData	{		[Key(0)]		public bool IsSoundOn;		public SoundVolumeComponentResolver In(ref SoundVolumeComponent soundvolumecomponent)		{			this.IsSoundOn = soundvolumecomponent.IsSoundOn;			return this;		}		public void Out(ref Entity entity)		{			var local = entity.GetComponent<SoundVolumeComponent>();			Out(ref local);		}		public void Out(ref SoundVolumeComponent soundvolumecomponent)		{			soundvolumecomponent.IsSoundOn = this.IsSoundOn;		}	}}